import React, { useState } from 'react';
import Dashboard from './components/Dashboard';
import Products from './components/Products';
import Orders from './components/Orders';
import './App.css';

function App() {
  const [view, setView] = useState('dashboard');

  return (
    <div className="App">
      <h1>Grocery Store Management</h1>
      <div className="nav-buttons">
        <button onClick={() => setView('dashboard')} className={view === 'dashboard' ? 'active' : ''}>Dashboard</button>
        <button onClick={() => setView('products')} className={view === 'products' ? 'active' : ''}>Products</button>
        <button onClick={() => setView('orders')} className={view === 'orders' ? 'active' : ''}>Orders</button>
      </div>

      {view === 'dashboard' && <Dashboard />}
      {view === 'products' && <Products />}
      {view === 'orders' && <Orders />}
    </div>
  );
}

export default App;
